import React from 'react';

class InterviewCard extends React{
    constructor(){
        super();
    }


    render(){
        const{interviewList}=this.props;

        return(
            <div className="interview-card">
                <table>
                    {interviewList.map((interviews)=><tr>interview.company</tr>)}
                </table>
            </div>
        )
    }

}

export default InterviewCard;
